import React from 'react';
import s from './BigProjects.module.css';

function BigProjects(props) {

    return (
        <div className={s.body}>
            <p id={s.bigProjects}>BigProjects</p>
            <p id={s.description}>SOME STARTUPS AND COMPANIES THAT I HELPED TO CREATE THEIR TECH</p>

            {/* styles of bigProject's cart*/}
            <div className={s.cart}>
                <img src="https://scontent.fevn8-1.fna.fbcdn.net/v/t1.6435-9/141991638_113325160699106_508126099903898757_n.png?_nc_cat=106&ccb=1-3&_nc_sid=09cbfe&_nc_ohc=FlQt8_Y3FN0AX82Xp8s&_nc_ht=scontent.fevn8-1.fna&oh=e54c514b801f79942fbd74c9fd93c3af&oe=60DBBAF9" alt="" />
                <span>itWorld</span>
                <span>Lorem ipsum dolor sit amet, consectetur adipisicing elit.</span>
                <button>wisit website</button>
            </div>
        </div>
    );
}

export default BigProjects;
